import * as React from 'react';

import { Typography, Divider } from '@material-ui/core';
import { Fade } from 'react-reveal';

import Graduation from '../images/grad.jpg';

const Landing = (props) => {
  return (
    <div className='landing'>
      <Fade big>
        <Divider variant="middle" classes={{ root: props.classes.divider }} />
      </Fade >      
      <div className='grid-2-h'>
        <div className='about-me'>
          <Fade left>
            <Typography style={{
              display: 'flex',
              alignItems: 'center',
            }} variant='h3'>About me</Typography>
            <Typography style={{
              display: 'flex',
              alignItems: 'center',
            }} variant='body1'>Hi, my name is John,(Populate with text describing me)</Typography>
          </Fade>
        </div>
        <div className='landing-image-container'>
          <Fade right>
            <img className='landing-image' src={Graduation} alt='High School Graduation' />
          </Fade>          
        </div>
      </div>
    </div>
  );
}
export default Landing;
